import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import * as serviceWorker from "./serviceWorker";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import {
  RoomProvider
} from "./context";
ReactDOM.render( <
  RoomProvider >
  <
  Router >
  <
  App / >
  <
  /Router> <
  /RoomProvider>,
  document.getElementById("root")
);

